'use client';
import React, { useState } from 'react';

export default function LoginAdmin() {
  const [usuario, setUsuario] = useState('');
  const [senha, setSenha] = useState('');
  const [logado, setLogado] = useState(false);

  const handleLogin = (e: React.FormEvent) => {
    e.preventDefault();
    // Credenciais de acesso conforme seu código original
    if (usuario === 'admin' && senha === '123') {
      setLogado(true);
    } else {
      alert('Usuário ou senha incorretos!');
    }
  };

  if (logado) {
    return (
      <div
        style={{
          backgroundColor: '#000',
          color: '#fff',
          minHeight: '100vh',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          gap: '20px',
        }}
      >
        {/* LOGO TAMBÉM NO PAINEL DE BEM-VINDO */}
        <img
          src="data:image/jpeg;base64,"
          alt="Logo JKB"
          style={logoStyle}
        />

        <h2 style={{ color: '#CCAA66' }}>✨ Seja bem-vindo, Jovike Batista!</h2>
        <p>O que deseja gerenciar agora?</p>

        <div
          style={{
            display: 'flex',
            flexDirection: 'column',
            gap: '15px',
            width: '300px',
          }}
        >
          <button
            onClick={() => (window.location.href = '/painel')}
            style={btnMenu}
          >
            📋 Ver Comandas
          </button>
          <button
            onClick={() => (window.location.href = '/estoque')}
            style={btnMenu}
          >
            📦 Gerenciar Estoque
          </button>

          <button
            onClick={() => (window.location.href = '/')}
            style={{
              ...btnMenu,
              background: 'transparent',
              color: '#CCAA66',
              border: '2px solid #CCAA66',
            }}
          >
            🏠 Voltar para o Catálogo
          </button>
        </div>

        <button
          onClick={() => setLogado(false)}
          style={{
            marginTop: '20px',
            background: 'none',
            border: 'none',
            color: '#dc3545',
            cursor: 'pointer',
            textDecoration: 'underline',
          }}
        >
          Sair da conta
        </button>
      </div>
    );
  }

  return (
    <div
      style={{
        backgroundColor: '#111',
        minHeight: '100vh',
        display: 'flex',
        flexDirection: 'column', // Mudado para alinhar logo e caixa verticalmente
        justifyContent: 'center',
        alignItems: 'center',
      }}
    >
      {/* LOGO CENTRALIZADA ACIMA DO ACESSO ADMIN */}
      <img
        src="data:image/jpeg;base64,"
        alt="Logo JKB"
        style={{ ...logoStyle, marginBottom: '20px' }}
      />

      <div
        style={{
          background: '#000',
          padding: '40px',
          borderRadius: '15px',
          border: '1px solid #CCAA66',
          width: '350px',
          textAlign: 'center',
        }}
      >
        <h2 style={{ color: '#CCAA66', marginBottom: '25px' }}>
          Acesso JKB Admin
        </h2>
        <form
          onSubmit={handleLogin}
          style={{ display: 'flex', flexDirection: 'column', gap: '15px' }}
        >
          <input
            type="text"
            placeholder="Usuário"
            value={usuario}
            onChange={(e) => setUsuario(e.target.value)}
            style={inputStyle}
          />
          <input
            type="password"
            placeholder="Senha"
            value={senha}
            onChange={(e) => setSenha(e.target.value)}
            style={inputStyle}
          />
          <button type="submit" style={btnEntrar}>
            Entrar
          </button>
          <button
            type="button"
            onClick={() => (window.location.href = '/')}
            style={btnVoltar}
          >
            Voltar
          </button>
        </form>
      </div>
    </div>
  );
}

// Estilos padronizados
const logoStyle = {
  width: '100px',
  height: '100px',
  borderRadius: '50%',
  border: '2px solid #CCAA66',
  objectFit: 'cover' as 'cover',
};

const inputStyle = {
  padding: '15px',
  borderRadius: '5px',
  border: 'none',
  backgroundColor: '#222',
  color: '#fff',
};

const btnEntrar = {
  background: '#CCAA66',
  color: '#000',
  padding: '15px',
  borderRadius: '5px',
  fontWeight: 'bold' as 'bold',
  cursor: 'pointer',
  border: 'none',
};

const btnVoltar = {
  background: '#333',
  color: '#fff',
  padding: '12px',
  borderRadius: '5px',
  border: 'none',
  cursor: 'pointer',
};

const btnMenu = {
  background: '#CCAA66',
  color: '#000',
  padding: '18px',
  borderRadius: '10px',
  fontWeight: 'bold' as 'bold',
  fontSize: '16px',
  cursor: 'pointer',
  border: 'none',
};
